import React from 'react';

const Users = props => {

  const users = props.users.users.map((user, id) => {
    return <li key={id}>{user.id}. &nbsp; {user.username}</li>;
  });

  return (
    <div id="userList" className="viewable">
      <h2>{users}</h2>
    </div>
  );
};

export default Users;





